import React from "react";
import books from "../Books";

function Book(props){
    return <div className="book">
    <h3>{props.title}</h3>
    <p>{props.subtitle}</p>
    <p>{props.published}</p>
    <p>{props.author}</p>
    <a href={props.website}><button>Know more</button></a>
    </div>
}

export default Book;
